import {ProjectElement} from '../components/ProjectFolder/ProjectPage/ProjectElements'
import { ProjectOneInfo, ProjectTwoInfo} from '../components/ProjectFolder/Projects/Data';

const Projects = () => {
  return(
    <>
    <ProjectElement {...ProjectOneInfo} />
    <ProjectElement {...ProjectTwoInfo} />
    <img src={require('../content/svg/svg-5.svg')} alt="car" />
    </>
  )
}


export default Projects;
